    try {
        const asistencia = await Asistencia.findAll();
        res.json(asistencia);
    } catch (e) {
        console.log(e);
    }

}

export async function crearAsistencia(req, res) {
    const { fecha, horario, id_cliente } = req.body;
    try {

        let nuevoAsistencia = await Asistencia.create({
            fecha,
            horario,
